using MyIdLibrary.Models;
using System.Runtime.Versioning;

namespace TestProject1;

[TestClass]
public class UnitTest_IdItem
{

    [TestMethod]
    public void Test_UniqId()
    {
        int testSize = 1000000; //1M
        HashSet<string> uniqIds = new();
        HashSet<Guid> uids = new();
        for (int i = 0;i < testSize; i++) {
            var idItem = new IdItem();
            Assert.AreEqual(23, idItem.UniqId.Length);
            Assert.IsTrue(uniqIds.Add(idItem.UniqId));
            Assert.IsTrue(uids.Add(idItem.Uid));
        }

        Assert.AreEqual(testSize, uniqIds.Count);
        Assert.AreEqual(testSize, uids.Count);
    }


    [TestMethod]
    public void Test_Memo1Line()
    {
        var idItem = new IdItem();
        idItem.Memo = "one line";
        Assert.AreEqual("one line", idItem.Memo1Line);

        idItem.Memo = "line 1\nline 2";
        Assert.AreEqual("line 1 line 2", idItem.Memo1Line);

        idItem.Images.Add("key", "value");
        Assert.AreEqual("(1 file) line 1 line 2", idItem.Memo1Line);

        idItem.Images.Add("key2", "value2");
        Assert.AreEqual("(2 files) line 1 line 2", idItem.Memo1Line);
    }

    [TestMethod]
    public void Test_ChangedHuman()
    {
        var idItem = new IdItem();
        //Changed = DateTime.UtcNow; Assigned with new object
        Assert.AreEqual(DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss"), idItem.ChangedHuman);
    }

    [TestMethod]
    public void Test_PasswordTip()
    {
        var idItem = new IdItem();
        idItem.Password = "angela";
        Assert.AreEqual("Common password.", idItem.PasswordTip);

        idItem.Password = "e234567";
        Assert.AreEqual( "Too short, 8 characters minimum.", idItem.PasswordTip);
    }

    [TestMethod]
    public void Test_GetMimeType()
    {
        var idItem = new IdItem();
        Assert.AreEqual("application/pdf", idItem.GetMimeType("file.pdf"));
        Assert.AreEqual("image/jpeg", idItem.GetMimeType("file.jpg"));
        Assert.AreEqual("image/png", idItem.GetMimeType("file.png"));
        Assert.AreEqual("application/zip", idItem.GetMimeType("file.zip"));
    }

    [TestMethod]
    [SupportedOSPlatform("windows")]
    public void Test_GetThumbnail()
    {
        IdItem idItem = new IdItem();
        Assert.AreEqual("https://upload.wikimedia.org/wikipedia/commons/thumb/6/6c/PDF_icon.svg/100px-PDF_icon.svg.png", idItem.GetThumbnail("file.pdf", 100,100));

        idItem.Images.Add("diego-ph-fIq0tET6llw-unsplash.jpg", @"");


        Assert.AreEqual(@"data:image/jpeg;base64, ", idItem.GetThumbnail("diego-ph-fIq0tET6llw-unsplash.jpg", 100,100));

    }

}